measurements.description:
Seven flowers on three up to 35.2-cm inflorescences;
 sepals acuminate, cream, suffused and veined dark magenta;
 petals acute, ruffled, cream, heavily overlaid dark magenta
 mid-petal vein and suffused dark magenta edges;
 lip ruffled, tubular over column, throat yellow veined dark magenta;
 column cream, anther cap cream; 
substance medium, texture crystalline.
